new Promise(((e,l)=>{projects?e():l("Filters element do not exist")})).then((e=>{for(let e of projects)e.isVisible&&(document.getElementById("grid").innerHTML+='<article class="c-cell '+e.filters+' u-radius">        <header class="c-cell__header">          <h3 class="c-cell__title">            <a class="js-link--content c-cell__link"            href="'+e.href+'"            aria-label="'+e.label+'"            data-template="'+e.templatePath+'"            target="_top">'+e.name+'</a>          </h3>          <aside class="c-cell__mark u-radius"><img src="/assets/icons/'+e.type+'.svg" alt="Case study about '+e.type+'" class="c-cell__icn"></aside>        </header>        <figure class="c-cell__fig">          <img src="'+e.img+'" alt="'+e.imgAlt+'" class="c-cell__img">        </figure>        <footer class="c-cell__info">          <ul id="badge-'+e.id+'" class="l-list"></ul>          <p>For: '+e.beneficiary+"</p>          <p>"+e.desc+"</p>        </footer>      </article>",moduleViewRenderer.getViewBadges(e.themes,document.getElementById("badge-"+e.id)))}),(e=>{})).finally((()=>{moduleRouter.linksListener("js-link--content")}));